import './App.css';
import React, {useState} from 'react';
import axios from 'axios';
import 'bootstrap/dist/css/bootstrap.min.css';
import Container from 'react-bootstrap/Container';
import Card from 'react-bootstrap/Card';


function App() {
  // const url='https://api.openweathermap.org/data/2.5/weather?q=amsterdam&appid=a676acc70dc743e06082235a87017ecf'
  return (
    <div className='app'>
      <Container>
      <Card>
        <Card.Body>
          <Card.Title className='location'>Location</Card.Title>
          <Card.Text className='temperture'>Current Temperture</Card.Text>
          <Card.Text className='description'>Description</Card.Text>
          <Card.Text className='clouds'>Clouds</Card.Text>
          <Card.Text className='humidity'>Current Humidity</Card.Text>
          <Card.Text className='wind'>Wind</Card.Text>
        </Card.Body>
      </Card>
      </Container>
    </div>
  );
}

export default App;
